  render(){
    return(
      <div>
        <h1 style = {{color: "gold", fontSize: "48px", textAlign: 'center'}}> LUC Course Evaluation Web-App </h1>
        <div className = 'topHeader'>
          <img src = {Logo} alt='Loyola Logo' />

        </div>




      </div>











    )
  }
}
